import React, { useState } from 'react';
// import { TextField } from '@material-ui/core';

function BookingForm() {
    const [email, setEmail] = useState("");
    const [name, setName] = useState("");
    const [subject, setSubject] = useState("");
    const [message, setMessage] = useState("");
    const [errorMessages, setErrorMessages] = useState([]);

const [showErrors, setShowErrors] = useState(false);
    return (
        <>
            <form>
                <input label="Name" type="text" onChange={e => setName({ name: e.target.value })} />

                <input label="Email" type="email" onChange={e => setEmail({ email: e.target.value })} />
                <input label="Subject" type="text" onChange={e => setSubject({ subject: e.target.value })} />
                <input label="Message" type="text" onChange  ={e => setMessage({message: e.target.value})}/>
                <Button color="primary" type="button">  Submit </Button>
            </form>
        </>
    );
}

export default BookingForm;
